import React, {useEffect} from 'react';
import { Link } from 'react-router-dom';
import UserService from '../service/UserService';

function Navbar() {
    const isAuthenticated = UserService.isAuthenticated();
    const isAdmin = UserService.isAdmin();
    const isUser = UserService.isUser();

    const isLoggedIn = localStorage.getItem('role');

    useEffect(() => {

    }, [])

    const handleLogout = () => {
        const confirmDelete = window.confirm('Are you sure you want to logout this user?');
        if (confirmDelete) {
            UserService.logout();
        }
    };

    return (
        <nav>
            <ul>
                {!isAuthenticated && <li><Link to="/">Fellow Coder</Link></li>}
                {isAuthenticated && <li><Link to="/profile">Profile</Link></li>}
                {isAdmin && !!isLoggedIn && <li><Link to="/admin/user-management">User Management</Link></li>}
                {isAdmin && <li><Link to="/admin/video-management">Video Management</Link></li>}
                {isUser && <li><Link to="/user/video-management">Video Management</Link></li>}
                {isAuthenticated && <li><Link to="/" onClick={handleLogout}>Logout</Link></li>}
            </ul>
        </nav>
    );
}

export default Navbar;
